import React from "react";

function Professor() {
  return (
    <div style={{ padding: "40px" }}>
      <h1>Mode Professeur</h1>
      <p>Ici, les enseignants déposeront les copies et les corrigés.</p>
    </div>
  );
}

export default Professor;
